import "./home.css";

function Home() {
  return (
    <div className="App">
      <header className="App-header">
        <button>דף הבית</button>
        <button>סקרים</button>
        <button>פרסומות</button>
        <button>אתר</button>
      </header>
    </div>
  );
}

export default Home;
